import './App.css';
import 'animate.css';
function App() {
  return (
    <div className="App">
      <head>
        <link
          rel="stylesheet"
          href="https://cdnjs.cloudflare.com/ajax/libs/animate.css/4.1.1/animate.min.css" />
      </head>
      <h1 class="animate__animated animate__bounce">An animated element</h1>
    </div>
  );
}

export default App;
